import React from 'react';
import {useEffect} from "react";
import axios from "axios";

import './Login.css';
import icon from '../img/forest_icon.png'

const Login = () => {
    useEffect(() => {
        axios.get('http://localhost:8080/api/login')
            .then((res) => {
                console.log("test" + res.data)
            });
    }, []);
    return (
        <div className="Body">
            <div className="image">
                <img src={icon} alt="main_icon"/>
            </div>

            <div className="title">
                <label className="title">Sign in to your account</label>
            </div>

            <form id="login-form">

                <label className="id-label" htmlFor="ID">ID</label>

                <div className="id-input">
                    <input type="text" id="id" name="id" required/>
                </div>

                <div className="password-group">
                    <label className="password-label" htmlFor="password">Password</label>
                    <a className="password-a" href="/forgot">Forgot password?</a>
                </div>

                <div className="password-input">
                    <input type="password" id="password" name="password" required/>
                </div>

                <button type="submit">Sign in</button>

                <div className="register">
                    <label htmlFor="register">Don't have an account?</label>
                    <a href="/register">Create an account</a>
                </div>
            </form>
        </div>
    );
};

export default Login;
